import {Component} from 'react'
import styled from 'styled-components';


export const ProjectContentWarp = styled.div`
flex-grow:4;
`

class ProjectContent extends Component{
    render(){
        return(
            <ProjectContentWarp>
                <h1>Content</h1>
            </ProjectContentWarp>
        )
    }
}

export default ProjectContent
